    "# Perform PCA on the GSEA results matrix.\n",
    "pca = PCA(n_components=5)\n",
    "pca_result = pca.fit_transform(filtered_gsea_results_matrix)\n",
    "true_labels = adata.obs.labels\n",
    "\n",
    "# Dictionary to store the silhouette scores.\n",
    "silhouette_scores = {}\n",
    "\n",
    "# Loop through each component.\n",
    "for component in tqdm(range(5)):\n",
    "    # Omit the current component.\n",
    "    pca_result_omitted = np.delete(pca_result, component, axis=1)\n",
    "    \n",
    "    # Perform KMeans clustering.\n",
    "    num_clusters = len(np.unique(true_labels))\n",
    "    kmeans = KMeans(n_clusters=num_clusters, random_state=0).fit(pca_result_omitted)\n",
    "    cluster_assignments = kmeans.labels_\n",
    "    \n",
    "    # Evaluate clustering results using silhouette score.\n",
    "    score = adjusted_mutual_info_score(true_labels, cluster_assignments)\n",
    "    \n",
    "    # Store the silhouette score.\n",
    "    silhouette_scores[component] = score\n",
    "\n",
    "# Sort the components according to the silhouette score (higher is better).\n",
    "sorted_components = sorted(silhouette_scores.items(), key=lambda x: x[1], reverse=True)\n",
    "\n",
    "# Display the top 5 performing components.\n",
    "top_components = sorted_components[:5]\n",
    "print(\"Top 5 performing components:\")\n",
    "for component, score in top_components:\n",
    "    print(f'Component: {component}, Silhouette Score: {score}')\n",
    "\n",
    "# Display the top 5 gene sets with the highest loading coefficients for the top-performing components.\n",
    "loading_matrix = pca.components_\n",
    "gene_sets = reactome['geneset'].unique()\n",
    "\n",
    "for component, score in top_components:\n",
    "    print(f'\\nComponent: {component}, Silhouette Score: {score}')\n",
    "    loadings = loading_matrix[component]\n",
    "    top_gene_sets_indices = np.argsort(np.abs(loadings))[-5:][::-1]\n",
    "    top_gene_sets_indices = [idx for idx in top_gene_sets_indices if idx < len(gene_sets)]\n",
    "    top_gene_sets = gene_sets[top_gene_sets_indices]\n",
    "    for gene_set in top_gene_sets:\n",
    "        print(gene_set)"
