    "sc.pl.embedding(adata, basis='umap_auc', color=['kmeans_auc'], title='KMeans Clustering on Simulated Values')\n",
    "sc.pl.embedding(adata, basis='umap_auc', color=[\"labels\"], title=\"UMAP of True Labels\")"
