    "sc.pl.embedding(adata, basis='umap_pathsingle', color=['kmeans_pathsingle'], title='KMeans Clustering on Simulated Values')\n",
    "sc.pl.embedding(adata, basis='umap_pathsingle', color=[\"labels\"], title=\"UMAP of True Labels\")"
